import React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

const Terms = () => (
  <Box sx={{ maxWidth: 600, mx: 'auto', my: 6, px: 2 }}>
    <Typography variant="h4" sx={{ fontWeight: 700, mb: 2 }}>
      利用規約
    </Typography>
    <Typography sx={{ fontSize: 15, color: '#444', mb: 2 }}>
      本サービス（AIゴルフクラブ診断β版）は、以下の利用規約に同意いただいた上でご利用ください。
    </Typography>
    <Typography sx={{ fontSize: 14, color: '#666', mb: 2 }}>
      ※本ページはダミーです。正式な利用規約文をここに掲載してください。
    </Typography>
    <Typography sx={{ fontSize: 13, color: '#888' }}>
      1. 本サービスはβ版であり、予告なく内容の変更・停止を行う場合があります。<br />
      2. 本サービスの情報は参考情報であり、最終的な判断はご自身で行ってください。<br />
      3. その他、運営者が必要と判断した事項は随時本ページにて告知します。
    </Typography>
  </Box>
);

export default Terms;
